import * as React from 'react';
import { LineChart } from '@mui/x-charts/LineChart';


export default function BasicLineChart(props) {
  const uData = props.data.slice(0,25);
const pData = props.data.slice(0,25);
const xLabels = props.time.slice(0,25);
  return (
    <LineChart
      width={500}
      height={300}
      series={[
        { data: pData, label: 'pv' },
        { data: uData, label: 'uv' },
      ]}
      xAxis={[{ scaleType: 'point', data: xLabels }]}
    />
  );
}
